import {Container} from './styles'
import Logo from '../../assets/Logo.png'
import Login from '../../assets/Login.png'
import { Link } from 'react-router-dom';


const Main_navbar = () => {


    return (
        <Container>
            <div>
                <img class="logo-img" src={Logo}></img>
            </div>

            <div class="links">
                {/* <a href="http://localhost:2000/Menu" > Cardápio </a>
                <a href="http://localhost:2000/Sales" > Promoções </a>
                <a href="http://localhost:2000/Contact" > Contato</a> */}
                <Link to='/Menu'>Cardápio</Link>
                <Link to='/Sales'>Promoções</Link>
                <Link to='/Menu'>Contato</Link>
            </div>

            <div>
                <img class="login-img" src={Login}></img>
            </div>
        </Container>


    );
}

export default Main_navbar;
